import React, { Component } from 'react';

class TopNavRightIcon extends Component {
    
    render() {
        return (
        <a
            href={this.props.href}
            title={this.props.title}
            id={this.props.id}
        >
            {this.props.media}
            <i
                className={this.props.className}
            >

            </i>
        </a>
    );
    }
};

export default TopNavRightIcon;
